        //   <div className="ml-3">
        //     <p className="text-sm font-medium text-gray-900">{person.name}</p>
        //     <p className="text-sm text-gray-500">{person.email}</p>
        //   </div>
        // </li>
      ))}
    </ul>
    </div>
  )
}

export default charInfos
